class Item extends Component{
    constructor(props) {
        super(props);

    }
    render(){
        return(
            <li>
                {this.props.value}
                <button
                    onClick={this.props.onParentDeleteClick(this.props.index)}
                >delete</button>
            </li>
    )
    }
    }

    export default Item;
